namespace Polkanalysis.Domain.Integration.Tests.Runtime.Extrinsic
{
    public class ExtrinsicTimestampTest : PolkadotIntegrationTest
    {

        private ISubstrateDecoding _substrateDecode;
        private IMetadataService _currentMetaData;

        [SetUp]
        public void Setup()
        {
            _currentMetaData = new MetadataService(_substrateService,
                                                      _substrateDbContext,
                                                      Substitute.For<ICoreService>(),
                                                      Substitute.For<ILogger<MetadataService>>());

            _substrateDecode = new SubstrateDecoding(
                new EventNodeMapping(),
                _substrateService,
                new PalletBuilder(
                    _substrateService,
                    _currentMetaData, Substitute.For<ILogger<PalletBuilder>>()),
                _currentMetaData,
                Substitute.For<ILogger<SubstrateDecoding>>());
        }

        /// <summary>
        /// Extrinsic from here : https://polkadot.js.org/apps/?rpc=wss%3A%2F%2Frpc.polkadot.io#/extrinsics/decode/0x280403000b207eba5c8501
        /// </summary>
        /// <param name="extrinsicHash"></param>
        /// <returns></returns>
        [Test]
        [TestCase("0x280403000b207eba5c8501")]
        public async Task TimestampsExtrinsic_WithTimeSet_ShouldBeParsedAsync(string extrinsicHash)
        {
            var extrinsic = new Substrate.NetApi.Model.Extrinsics.Extrinsic(extrinsicHash, ChargeTransactionPayment.Default());
            var res = await _substrateDecode.DecodeExtrinsicAsync(extrinsic, null, CancellationToken.None);
            Assert.That(res.Name, Is.EqualTo("Timestamp"));
        }

